import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import mobileImg from "../../Assets/mobile.jpg";
import laptopImg from "../../Assets/laptop.jpeg";
import speakerImg from "../../Assets/speaker.jpeg";

function Landing() {
  const navigate = useNavigate();
  const handleBookRepair = () => navigate("/jobform");
  const handleCheckStatus = () => navigate("/check-status");

  const StarRating = ({ stars }) => (
    <div className="text-amber-400 text-lg">
      {"★".repeat(stars)}
      {"☆".repeat(5 - stars)}
    </div>
  );

  const [reviews, setReviews] = useState([
    {
      name: "Sarah M.",
      text: "My phone screen was replaced within an hour. Excellent service and very friendly staff!",
      stars: 5,
    },
    {
      name: "John D.",
      text: "Got my laptop fixed quickly. Works like new again. Affordable prices too!",
      stars: 4,
    },
    {
      name: "Emily R.",
      text: "They fixed my speaker perfectly. Now the sound is crystal clear. Highly recommend!",
      stars: 5,
    },
  ]);

  const [formData, setFormData] = useState({ name: "", text: "", stars: 5 });

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleStarClick = (stars) => {
    setFormData({ ...formData, stars });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name || !formData.text) return;

    const newReviews = [...reviews, formData];
    if (newReviews.length > 3) newReviews.shift();

    setReviews(newReviews);
    setFormData({ name: "", text: "", stars: 5 });
  };

  return (
    <div className="bg-gray-100 min-h-screen">
      {/* Carousel Section */}
      <div className="max-w-5xl mx-auto pt-12">
        <div className="relative w-full overflow-hidden rounded-lg shadow-lg">
          <div className="animate-fadeIn">
            <img
              src={mobileImg}
              alt="Mobile Repair"
              className="w-full h-[400px] object-cover rounded-lg"
            />
            <div className="absolute bottom-0 w-full bg-blue-800/70 text-white py-4 rounded-b-lg text-center">
              <h5 className="text-xl font-semibold">Mobile Repairs</h5>
              <p>Screen, battery, charging issues fixed quickly.</p>
            </div>
          </div>
        </div>

        {/* Buttons */}
        <div className="text-center mt-8 space-x-4">
          <button
            onClick={handleBookRepair}
            className="bg-amber-400 text-gray-900 font-semibold px-8 py-3 rounded-full hover:bg-amber-500 transition"
          >
            Book a Repair
          </button>
          <button
            onClick={handleCheckStatus}
            className="bg-blue-700 text-white font-semibold px-8 py-3 rounded-full hover:bg-blue-800 transition"
          >
            Check Repair Status
          </button>
        </div>
      </div>

      {/* Reviews Section */}
      <div className="bg-white py-16 mt-12">
        <div className="max-w-6xl mx-auto px-6">
          <h2 className="text-center text-3xl font-bold text-blue-700 mb-12">
            What Our Customers Say
          </h2>

          {/* Review Cards */}
          <div className="grid md:grid-cols-3 gap-8">
            {reviews.map((review, idx) => (
              <div
                key={idx}
                className="bg-gray-100 p-6 rounded-2xl shadow-md hover:-translate-y-1 transition transform"
              >
                <StarRating stars={review.stars} />
                <p className="text-gray-600 mt-3">"{review.text}"</p>
                <h6 className="font-bold text-gray-900 mt-4">- {review.name}</h6>
              </div>
            ))}
          </div>

          {/* Add Review Form */}
          <div className="mt-16 max-w-lg mx-auto">
            <h4 className="text-center text-xl font-semibold mb-6">
              Add Your Review
            </h4>
            <form onSubmit={handleSubmit} className="space-y-4">
              <div>
                <label className="block mb-1 font-medium">Your Name</label>
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleInputChange}
                  className="w-full border border-gray-300 rounded-lg px-3 py-2 focus:ring focus:ring-blue-200"
                  placeholder="Enter your name"
                  required
                />
              </div>
              <div>
                <label className="block mb-1 font-medium">Your Review</label>
                <textarea
                  name="text"
                  rows="3"
                  value={formData.text}
                  onChange={handleInputChange}
                  className="w-full border border-gray-300 rounded-lg px-3 py-2 focus:ring focus:ring-blue-200"
                  placeholder="Write your review"
                  required
                ></textarea>
              </div>
              <div className="text-center">
                <label className="block font-medium mb-1">Rating</label>
                <div className="text-2xl cursor-pointer">
                  {[1, 2, 3, 4, 5].map((star) => (
                    <span
                      key={star}
                      onClick={() => handleStarClick(star)}
                      className={`${
                        formData.stars >= star
                          ? "text-amber-400"
                          : "text-gray-300"
                      } mx-1`}
                    >
                      ★
                    </span>
                  ))}
                </div>
              </div>
              <div className="text-center">
                <button
                  type="submit"
                  className="bg-blue-700 text-white px-8 py-2 rounded-full font-semibold hover:bg-blue-800 transition"
                >
                  Submit Review
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Landing;
